    first: $first
    after: $after
    sort: $sort
    selectedFacets: $selectedFacets
  ) {
    products {
      pageInfo {
        totalCount
      }
      edges {
        node {
          id: productID
          slug
          sku
          name
          gtin
          isVariantOf {
            productGroupID
            name
          }
          image {
            url
            alternateName
          }
          brand {
            name
          }
          offers {
            lowPrice
            offers {
              price
              listPrice
              seller {
                identifier
              }
            }
          }
        }
      }
    }
    facets {
      key
      label
      type
      values {
